import React, { Component } from "react";
import { Button, Table } from "semantic-ui-react";
import Layout from "../../components/Layout";

class MailList extends Component {

  renderList() {
    const items = [
      {
        header:"최민호 ",
        description: <a>자세히보기</a>,
        meta: "부산광역시 해운대구 해운대로 61번길 73 해운대더샵센텀그린 103동 2202호"
      }
    ]

    return <Card.Group items={items} />;
  }

  render() {
    const { Header, Row, HeaderCell, Body } = Table;
    return (
      <Layout>
          <Button type="submit" basic color="violet" floated="right">
            택배 접수
          </Button>
          <Table>
            <Header>
              <Row>
                <HeaderCell>받는 사람</HeaderCell>
                <HeaderCell>주소</HeaderCell>
                <HeaderCell>연락처</HeaderCell>
                <HeaderCell>상품명</HeaderCell>
                <HeaderCell>배송 상태</HeaderCell>
                <HeaderCell>QR코드</HeaderCell>
              </Row>
            </Header>
          </Table>
      </Layout>
    );
  }
}

export default MailList;
